    private static void part2(LinkedList<String> list) {
        // TODO Auto-generated method stub
        long i1 = countTrees(1,1,list);
        long i2 = countTrees(3,1,list);
        long i3 = countTrees(5,1,list);
        long i4 = countTrees(7,1,list);
        long i5 = countTrees(1,2,list);
        
        long result = i1*i2*i3*i4*i5;
        
        System.out.println("2-"+result);
    }

    private static int countTrees(int i, int j, LinkedList<String> list) {
        int x = 0;
        int y = 0;
        
        int maxRow = list.get(0).length();
        
        int countTrees = 0;
        
        while(y<list.size()) {
            
            if(isTree(x, list.get(y))){
                countTrees++;
            }
            x = ((x+i)%maxRow);
            y=y+j;
        }

        return countTrees;
    }

    private static void part1(LinkedList<String> list) {
        int x = 0;
        int y = 0;
        
        int maxRow = list.get(0).length();
        
        int countTrees = 0;
        
        while(y<list.size()) {
            
            if(isTree(x, list.get(y))){
                countTrees++;
            }
            x = ((x+3)%maxRow);
            y++;
        }
        
        System.out.println("1-" + countTrees);
        
    }

    private static boolean isTree(int x, String string) {
        return string.charAt(x) == '#';
    }

